Subasta.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract Subasta {
    address public owner;
    uint public finSubasta;
    bool public finalizada;

    struct Oferta {
        address ofertante;
        uint monto;
    }

    Oferta public mejorOferta;
    mapping(address => uint) public depositos;
    Oferta[] public historialOfertas;

    uint public constanteComision = 2; // 2% de comisi√≥n para gas

    event NuevaOferta(address ofertante, uint monto);
    event SubastaFinalizada(address ganador, uint monto);

    modifier soloOwner() {
        require(msg.sender == owner, "Solo el owner puede ejecutar esto");
        _;
    }

    modifier subastaActiva() {
        require(block.timestamp < finSubasta, "La subasta ha finalizado");
        require(!finalizada, "Subasta ya finalizada");
        _;
    }

    modifier subastaFinalizada() {
        require(block.timestamp >= finSubasta || finalizada, "La subasta aun esta activa");
        _;
    }

    constructor(uint _duracionInicialSegundos) {
        owner = msg.sender;
        finSubasta = block.timestamp + _duracionInicialSegundos;
        mejorOferta = Oferta(address(0), 0);
    }

    function ofertar() external payable subastaActiva {
        require(msg.value > 0, "Debes enviar ETH");

        uint incrementoMinimo = (mejorOferta.monto * 105) / 100;
        if (mejorOferta.monto == 0) {
            incrementoMinimo = 1; // La primera oferta puede ser cualquier valor > 0
        }

        require(msg.value >= incrementoMinimo, "La oferta debe superar en al menos 5% a la actual");

        depositos[msg.sender] += msg.value;
        mejorOferta = Oferta(msg.sender, msg.value);
        historialOfertas.push(mejorOferta);

        // Si quedan menos de 10 minutos, extender la subasta
        if (finSubasta - block.timestamp <= 10 minutes) {
            finSubasta += 10 minutes;
        }

        emit NuevaOferta(msg.sender, msg.value);
    }

    function retirarExceso() external subastaActiva {
        uint ultimaOferta = 0;
        if (msg.sender == mejorOferta.ofertante) {
            ultimaOferta = mejorOferta.monto;
        }

        uint exceso = depositos[msg.sender] - ultimaOferta;
        require(exceso > 0, "No hay exceso para retirar");

        depositos[msg.sender] -= exceso;
        payable(msg.sender).transfer(exceso);
    }

    function devolverDepositos() external subastaFinalizada {
        require(msg.sender != mejorOferta.ofertante, "El ganador no recibe reembolso");

        uint monto = depositos[msg.sender];
        require(monto > 0, "No hay nada para devolver");

        uint comision = (monto * constanteComision) / 100;
        uint reembolso = monto - comision;

        depositos[msg.sender] = 0;
        payable(msg.sender).transfer(reembolso);
    }

    function finalizarSubasta() external soloOwner subastaFinalizada {
        require(!finalizada, "La subasta ya fue finalizada");
        finalizada = true;

        emit SubastaFinalizada(mejorOferta.ofertante, mejorOferta.monto);

        payable(owner).transfer(mejorOferta.monto);
    }

    function verGanador() external view subastaFinalizada returns (address, uint) {
        return (mejorOferta.ofertante, mejorOferta.monto);
    }

    function verHistorial() external view returns (Oferta[] memory) {
        return historialOfertas;
    }
}

